import React from "react";

const Footer = () => {
    return (
        <footer class="d-flex justify-content-center footer p-3">
            <h6>
                All rights reserved gilbert.gonzales &copy; 2021 <a href="https://github.com/" class="link"
                    target="_blank">g-gonzo</a>
            </h6>
        </footer>
    )
};

export default Footer;
